import thumbnailStyle from './thumbnail.module.css';

const Thumbnail = ({imageURL, caption}) => { 
    let imgUrl = `http://via.placeholder.com/210x295?text=${caption}`
    if(imageURL){
        imgUrl = imageURL
    }
    return(
        <div className="thumbnail">
            <img src={imgUrl} className={thumbnailStyle.image}/>
            <h3 className={thumbnailStyle.caption}>{caption}</h3>
        </div>
    );
};

export default Thumbnail;
